import { createWebHistory, createRouter } from "vue-router";
import Login from "./pages/LoginPage"
import SignUp from './pages/SignUp'
import Main from './pages/MainPage'
import CoopMain from './pages/COOPmanagement/CoopMainPage.vue'
import InvenMain from './pages/InventoryManagement/InventoryMainPage.vue'
import StatisticsMain from './pages/Statistics/StatisticsMainPage.vue'
import TransactionMain from './pages/TransactionManagement/TransactionMainPage.vue'
// import C1M1 from "./pages/category1/Menu1Page"

const routes = [
    {
        path: "/login",
        component: Login,
        name:'login'
    },
    {
        path: "/signup",
        component: SignUp,
        name:'singup',
    },
    {
        path: "/home",
        component: Main,
        name:"home"
    },
    {
        path:"/coop-management",
        component:CoopMain,
        name:'coop-main',
        children:[
            {
                path:'menu1',
                name:'menu1',
                
            }
        ]
    },
    {
        path:"/inventory-management",
        component:InvenMain,
        name:'category2',
        children:[
            {
                path:'menu1',
                name:'menu1',
            }
        ]
    },
    {
        path:"/transaction-management",
        component:TransactionMain,
        name:'category3',
        children:[
            {
                path:'menu1',
                name:'menu1',
            }
        ]
    },
    {
        path:"/statistics",
        component:StatisticsMain,
        name:'category4',
        children:[
            {
                path:'menu1',
                name:'menu1',
            }
        ]
    },
    {
        path:'/', redirect:'/login'
    }

]
    

const router = createRouter({
    history:createWebHistory(),
    routes
});

export default router
